import React from 'react';

const Background = () => {
  return (
    <>
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 841.9 595.3">
        <g fill="#61DAFB">
          <path d="M666.3 ... 50.6zM320.8 78.4z" />
          <circle cx="420.9" cy="296.5" r="45.7" />
          <path d="M520.5 78.1z" />
        </g>
      </svg>
    </>
  );
};

export { Background };
